import React from 'react';
import MentorForm from './components/MentorForm.js';
import StudentForm from './components/StudentForm.js';
import MentorList from './components/MentorList.js';
import StudentList from './components/StudentList.js';

function App() {
  return (
    <div className="App">
      <h1>Mentor-Student Management</h1>
      <MentorForm />
      <StudentForm />
      <MentorList />
      <StudentList />
    </div>
  );
}

export default App;
